import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './pages/Login';
import { StudentRegistration } from './pages/admin/StudentRegistration';
import { RoomRegistration } from './pages/admin/RoomRegistration';
import { StudentHome } from './pages/student/StudentHome';
import { AdminHome } from './pages/admin/AdminHome';
import { StudentList } from './pages/admin/StudentList';
import { RoomList } from './pages/admin/RoomList';
import { EditRoom } from './pages/admin/EditRoom';
import { RoomAssignment } from './pages/admin/RoomAssignment';
import PrivateRoute from './components/PrivateRoute';
import { EditStudent } from './pages/admin/EditStudent';
import RoomStudents from './pages/admin/RoomStudents';
import { UserHome } from './pages/user/UserHome';
import { RoomRegistration as UserRoomRegistration } from './pages/user/RoomRegistration';

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route
          path="/admin"
          element={
            <PrivateRoute requireAdmin>
              <AdminHome />
            </PrivateRoute>
          }
        />
        <Route
          path="/admin/student-registration"
          element={
            <PrivateRoute requireAdmin>
              <StudentRegistration />
            </PrivateRoute>
          }
        />
        <Route
          path="/admin/student-list"
          element={
            <PrivateRoute requireAdmin>
              <StudentList />
            </PrivateRoute>
          }
        />
        <Route
          path="/admin/student/:id/edit"
          element={
            <PrivateRoute requireAdmin>
              <EditStudent />
            </PrivateRoute>
          }
        />
        <Route
          path="/admin/room-registration"
          element={
            <PrivateRoute requireAdmin>
              <RoomRegistration />
            </PrivateRoute>
          }
        />
        <Route
          path="/admin/room-list"
          element={
            <PrivateRoute requireAdmin>
              <RoomList />
            </PrivateRoute>
          }
        />
        <Route
          path="/admin/room/:id/edit"
          element={
            <PrivateRoute requireAdmin>
              <EditRoom />
            </PrivateRoute>
          }
        />
        <Route
          path="/admin/room-assignment"
          element={
            <PrivateRoute requireAdmin>
              <RoomAssignment />
            </PrivateRoute>
          }
        />
        <Route
          path="/student/home"
          element={
            <PrivateRoute>
              <StudentHome />
            </PrivateRoute>
          }
        />
        <Route
          path="/user/home"
          element={
            <PrivateRoute>
              <UserHome />
            </PrivateRoute>
          }
        />
        <Route
          path="/user/room-registration/:roomId"
          element={
            <PrivateRoute>
              <UserRoomRegistration />
            </PrivateRoute>
          }
        />
        <Route path="/admin/room-students/:roomId" element={<RoomStudents />} />
        <Route path="/" element={<Navigate to="/login" replace />} />
      </Routes>
    </Router>
  );
};

export default App;
